// import logo from './logo.svg';

import Header from './Header';

function App() {
  return (
    <div className="body">
      <div className="page">
      <Header />
        <main className="content">
          <div className="profile">
            <div className="profile__avatar-wrapper">
              {/* <img src="<%=require('./images/image.jpg')%>" alt="Жак-Ив Кусто" class="profile__ellipse"> */}
              <button class="profile__ellipse-pencil" type="button"></button>
            </div>
            <div className="profile__info">
              <h1 className="profile__info-name">Жак-Ив Кусто</h1>
              <button type="button" className="profile__info-edit-button">
                {/* <img src="<%=require('./images/Vector(2).svg')%>" alt="Карандаш" class="profile__pencil"> */}
              </button>
              <p className="profile__info-text">Исследователь океана</p>
            </div>
            <button type="button" className="profile__add-button"></button>
          </div>
          <section className="elements">
          </section>
        </main>
        <footer className="footer">
          <p className="footer__copyright">&copy; 2022 Анастасия Муравьева</p>
        </footer>
      </div>
    </div>
  );
}

export default App;
